f6410fba0c18da60ad8c56.png&quot;,&quot;name&quot;:&quot;&quot;,&quot;displayMode&quot;:&quot;fill&quot;}}" data-motion-part="BG_IMG" data-bg-effect-name="" data-has-ssr-src=""><img src="https://static.wixstatic.com/media/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png/v1/fill/w_384,h_385,al_c,q_85,usm_0.66_1.00_0.01,enc_auto/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png" alt="Elliots Touch" style="width:384px;height:385px;object-fit:cover" width="384" height="385" srcSet="https://static.wixstatic.com/media/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png/v1/fill/w_384,h_385,al_c,q_85,usm_0.66_1.00_0.01,enc_auto/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png 1x, https://static.wixstatic.com/media/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png/v1/fill/w_707,h_709,al_c,lg_1,q_90,enc_auto/4b2a78_bd094c5349f6410fba0c18da60ad8c56.png 2x" fetchpriority="high"/></wow-image></div></div><div id="WRchTxt8" class="HcOXKn SxM0TO QxJLC3 lq2cno WRchTxt8 wixui-rich-text" data-testid="richTextElement"><p class="font_8 wixui-rich-text__text" style="font-size:16px;"><span style="color:#172CF5;" class="wixui-rich-text__text"><span style="font-family:palatino linotype,serif;" class="wixui-rich-text__text"><span style="font-size:16px;" class="wixui-rich-text__text"><span style="font-weight:bold;" class="wixui-rich-text__text">​How to help....</span></span></span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:16px;"><span class="color_5 wixui-rich-text__text"><span style="font-family:palatino linotype,serif;" class="wixui-rich-text__text"><span style="font-size:16px;" class="wixui-rich-text__text"><span style="font-weight:bold;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></span></span></span></p>

<p class="font_8 wixui-rich-text__text" style="line-height:1.3em; font-size:13px;">There are many ways you can get involved and help raise money for Elliot&#39;s Touch.</p>

<p class="font_8 wixui-rich-text__text" style="line-height:1.3em; font-size:13px;"><span class="wixui-rich-text__text">﻿</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">We have a number of places for you to organise events,</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">or you can be creative and do your own thing!</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">A cake sale, fun run, coffee morning, zumbathon, 5-a-side football - anything goes!</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">However you decide to get involved, your efforts and support will be very much appreciated.&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">Take a look at our <span style="text-decoration:underline;" class="wixui-rich-text__text"><a href="https://www.elliotstouch.org/fundraising" target="_self" class="wixui-rich-text__text">fundraising ideas</a></span> for more infomation.</p></div><div id="icre3spk" class="HcOXKn SxM0TO QxJLC3 lq2cno icre3spk wixui-rich-text" data-testid="richTextElement"><p class="font_8 wixui-rich-text__text" style="font-size:16px;"><span style="color:#172CF5;" class="wixui-rich-text__text"><span style="font-size:16px;" class="wixui-rich-text__text"><span style="font-family:palatino linotype,serif;" class="wixui-rich-text__text"><span style="font-weight:bold;" class="wixui-rich-text__text">Royal Brompton &amp; Harefield Hospitals</span></span></span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:16px;"><span class="color_5 wixui-rich-text__text"><span style="font-size:16px;" class="wixui-rich-text__text"><span style="font-family:palatino linotype,serif;" class="wixui-rich-text__text"><span style="font-weight:bold;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></span></span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">On the 12th July 2016, we were humbled to meet Paul and Donna, who sadly lost their infant son Elliot to mitochondrial disease and childhood cardiomyopathy last year at Great Ormond Street Hospital.</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">Ever since their tragic loss, Paul and Donna and the team at Elliot&rsquo;s Touch have bravely and tirelessly raised funds towards research into the condition, so that in future, children can be given a stronger fighting chance at life.</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">After doing some of their own research, Paul and Donna came across the Royal Brompton Hospital&rsquo;s&nbsp;very own Dr Sanjay Prasad, an expert in cardiomyopathy.</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">&nbsp;</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">With his fantastic team, Dr Prasad is working towards finding a simple and effective way to test for cardiomyopathy, so that children and adults with this condition can be diagnosed and treated earlier, or even avoid the need for medical intervention.</p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;"><span class="wixGuard wixui-rich-text__text">​</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:13px;">Elliot&rsquo;s Touch were able to meet with Dr Prasad and his team, learn more about their vital work, and, through their ambitious and truly remarkable fundraising efforts, present a generous cheque for ...... <span style="text-decoration:underline;" class="wixui-rich-text__text"><a href="https://www.elliotstouch.org/support-us" target="_self" class="wixui-rich-text__text">Read More</a></span></p></div></div></div></section></div></div></div></div></div></div></div></main><div id="soapAfterPagesContainer" class="page-without-sosp soapAfterPagesContainer page-without-sosp"><div data-mesh-id="soapAfterPagesContainerinlineContent" data-testid="inline-content" class=""><div data-mesh-id="soapAfterPagesContainerinlineContent-gridContainer" data-testid="mesh-container-content"><div id="CONTROLLER_COMP_CUSTOM_ID" style="display:none"></div></div></div></div><div id="pinnedBottomRight" class="pinnedBottomRight"><div id="comp-j1mcq4oo-pinned-layer" class="comp-j1mcq4oo-pinned-layer big2ZD"><div id="comp-j1mcq4oo" class="OQ8Tzd comp-j1mcq4oo pvlz2w"><iframe class="nKphmK" title="Wix Chat" aria-label="Wix Chat" scrolling="no" allowfullscreen="" allowtransparency="true" allowvr="true" frameBorder="0" allow="clipboard-write;autoplay;camera;microphone;geolocation;vr"></iframe></div></div></div><footer id="SITE_FOOTER" class="xU8fqS SITE_FOOTER wixui-footer" tabindex="-1"><div class="_C0cVf"><div class="_4XcTfy" data-testid="screenWidthContainerBg"></div></div><div class="U4Bvut"><div class="G5K6X8"><div class="gUbusX" data-testid="screenWidthContainerBgCenter"></div></div><div class="CJF7A2"><div data-mesh-id="SITE_FOOTERinlineContent" data-testid="inline-content" class=""><div data-mesh-id="SITE_FOOTERinlineContent-gridContainer" data-testid="mesh-container-content"><div id="WRchTxt9" class="HcOXKn SxM0TO QxJLC3 lq2cno WRchTxt9 wixui-rich-text" data-testid="richTextElement"><p class="font_7 wixui-rich-text__text" s